function formFilterController() {
    const formsFilter = document.querySelectorAll('[data-js="formFilter"]')

    if(formsFilter.length < 1) return

    formsFilter.forEach(formFilter => {
        formSpoilerController(formFilter)
        inputMasksInit(formFilter)

        const resetBtns = formFilter.querySelectorAll('[data-js="formResetBtn"]')

        if(resetBtns.length > 0) {
            resetBtns.forEach(btn => {
                btn.addEventListener('click', () => {
                    formReset(formFilter)
                })
            })
        }


    })
}



function fieldsController() {
    const fields = document.querySelectorAll('[data-js="formField"]')

    if(fields.length < 1) return

    fields.forEach(field => {
        const resetBtn = field.querySelector('[data-js="fieldResetBtn"]');
        const input = field.querySelector('input');
        const hasPrompt = field.hasAttribute('data-has-prompt')
        const fieldPrompt = field.querySelector('[data-js="fieldPrompt"]');

        if(resetBtn && input) {
            resetBtn.addEventListener('click', function() {
                input.value = ''
                input.dispatchEvent(new Event('change'));
            })
        }

        if(fieldPrompt && hasPrompt && input) {
            input.addEventListener('input', promptToggle)

            input.addEventListener('change', promptToggle)

        }

        function promptToggle() {
            if(input.value.length > 0) {
                fieldPrompt.classList.add('active')
            } else {
                fieldPrompt.classList.remove('active')
            }
        }
    })
    
}

function selects() {
	const formSelects = document.querySelectorAll("[data-js='formSelect']")

	formSelects.forEach(formSelect => {
		let placeholder = $(formSelect).attr('data-placeholder')

		$(formSelect).select2({
			placeholder: placeholder,
			allowClear: true
		});
	}) 

	$("[data-js='formSelect']").on('select2:open', () => {
		$(".select2-dropdown").addClass("select2-dropdown--form")
	})

}

function spoilers() {
    const accordions = document.querySelectorAll("[data-js='accordion']");

	if(accordions.length < 1) return

	accordions.forEach(accordion => {

		let firstSpoiler = accordion.querySelector('[data-js="spoiler"]')

		if(firstSpoiler) {
			openSpoiler(firstSpoiler)
		}

		accordion.addEventListener('click', (e) => {
			let eventTarget = e.target


			if(eventTarget.closest('[data-js="spoiler"]')) {
				let clickedSpoiler = eventTarget.closest('[data-js="spoiler"]')

				if(clickedSpoiler.classList.contains('active')) {
					return
				}

				let spoilers = accordion.querySelectorAll('[data-js="spoiler"]')

				spoilers.forEach(spoiler => {
					closeSpoiler(spoiler)
				})

				openSpoiler(clickedSpoiler)
			}
		})
	})

	function openSpoiler(spoiler) {
		const content = $(spoiler).find('[data-js="spoilerContent"]');
		spoiler.classList.add("active");
		$(content).slideDown(400);
	};

	function closeSpoiler(spoiler) {
		const content = $(spoiler).find('[data-js="spoilerContent"]');
		spoiler.classList.remove("active");
		$(content).slideUp(400);
	};
}

document.addEventListener('DOMContentLoaded', () => {
    fieldsController();
    formFilterController();
    selects();
    spoilers()
})

