function headerController() {
    const header = document.querySelector('[data-js="siteHeader"]')

    if(!header) return

    // высота по скроллу
   let lastScroll = window.scrollY ? window.scrollY : 0

    if(lastScroll > 10) {
        header.classList.add('small')
    }

    window.addEventListener('scroll', function() {
        let currentScroll = window.scrollY
        toggleHeader(lastScroll, currentScroll)
        lastScroll = currentScroll
    })

    function toggleHeader(lastScroll, currentScroll) {
        if(currentScroll <= lastScroll || currentScroll === 0) {
            header.classList.remove('small')
        } else {
            header.classList.add('small')
        }
    }

    // открытие бургера
    const burger = document.querySelector('[data-js="headerBurger"]')

    if(burger) {
        const burgerToggle = burger.querySelector('[data-js="headerBurgerToggle"]')

        burgerToggle.addEventListener('click', () => {
            const ww = window.innerWidth
            if(burger.classList.contains('active')) {
                burger.classList.remove('active')
                unlockBody()
            } else {
                burger.classList.add('active')
                lockBody()
            }
        })

        // подменю в бургере 
        const menuItems = burger.querySelectorAll('[data-js="headerMenuItem"]')

        if(menuItems.length > 0) {
            menuItems.forEach(item => {
                const submenu = item.querySelector('[data-js="headerMenuItemSubmenu"]')
                const minHeight = 0

                if(submenu) {
                    const maxHeight = submenu.scrollHeight

                    const openBtn = item.querySelector('[data-js="headerMenuItemOpen"]')
                    const closeBtn = item.querySelector('[data-js="headerMenuItemClose"]')

                    openBtn.addEventListener('click', () => {
                        submenu.style.maxHeight = maxHeight + 'px'
                        item.classList.add('active')
                    })

                    closeBtn.addEventListener('click', () => {
                        submenu.style.maxHeight = minHeight + 'px'
                        item.classList.remove('active')
                    })
                }
            })
        }
    }

    // открытие выпадашки с телефонами
    /*const phonesDropdown = document.querySelector('[data-js="phonesDropdown"]')

    if(phonesDropdown) {
        const phonesDropdownToggle = phonesDropdown.querySelector('[data-js="phonesDropdownToggle"]')

        phonesDropdownToggle.addEventListener('click', () => {
            $(phonesDropdown).toggleClass('active')
        })
    }*/
}

let modals = false

function modalsInit() {
    modals = new HystModal({
        linkAttributeName: "data-modal",
        catchFocus: false,
        beforeOpen: function(e){
            lockBody(true)
        },
        afterClose: function(){
            unlockBody()
        },
    });

    modalSlidesController()
}

function modalSlidesController() {
    const modalSlidesBlocks = document.querySelectorAll('[data-js="modalSlides"]')

    if(modalSlidesBlocks.length < 1) return

    modalSlidesBlocks.forEach(block => {
        const slidesList = block.querySelectorAll('[data-js="modalSlide"]')
        const radioTabsList = block.querySelectorAll('[data-js="modalSlidesTab"]')

        radioTabsList.forEach(tab => {
            tab.addEventListener('click', function() {

                const targetId = this.dataset.id

                if(targetId) {
                    changeSlide(slidesList, parseInt(targetId))
                }

            } )
        })
    })

    function changeSlide(slides, targetId) {
        slides.forEach((slide, index) => {
            if(index == targetId) {
                slide.classList.add('active')
            } else {
                slide.classList.remove('active')
            }
        })
    }
}


document.addEventListener('DOMContentLoaded', () => {
    modalsInit()
    headerController()
})